Information
------------------------------

&quot;Royal Secrets&quot; is a fascinating chronicle of human nature in power - its vices and virtues, strengths and failings. It is also an original and exciting guide to the huge sweep of European history out of whose bloody struggles for power the great European traditions of democracy, justice and chivalry painfully emerged. The ancient cult of royalty has always fascinated and inspired writers, historians and diarists. Stepping beyond the well-worn paths of history books, these half hour films will use little-known anecdotal stories to bring the personalities of those distant figures vividly to life. 

Produced by The Principal Film Company for The Learning Channel

11)  Lust 
A royal affair could be a dangerous liaison. Anne Boleyn flirted with Henry VIII and lost her head. England's Princess Caroline had flings on the side, like her husband, George IV, but fell victim to double standards. France's Louis XV was the lustiest monarch in history, and paid for it with his life.

